 Release Notes:

This is the retail version, we included the user manual for you so enjoy!

Eye Candy 5: Nature, is a collection of ten Photoshop filters, which 
create fire, smoke, rust, snow, ice and more. The second of a three-part 
upgrade to Eye Candy 4000, Nature offers beautifully rendered effects that 
any novice or professional designer will appreciate.

Nature includes four new filters and reincarnates six Eye Candy classics. 
The classic filters boast brand-new looks, greater realism, and improved 
ease-of-use. For example, select filters can create a new layer and render 
effects to it; this allows you to view, edit, or turn off these effects 
without modifying the original layer.

Nature includes over 500 presets for frequently used effects; you can 
find the perfect effect quickly. The improved settings management 
system makes it easy to browse, share and collect new settings.

Nature also works with 16-bit images. Color transitions are smoother, 
with less banding. Print documents reproduce colors more accurately. 


